import Img2 from '../images/유관기관2.png';
import Img3 from '../images/유관기관3.png';

import styles from './Aboutaone.module.css';

const Resources4 = () => {
  return (
    <div>
      <Top />
      <div className={styles.down}>유관기관 안내 </div>
      <div class="container">
        <br />
        <br />

        <br />
        <br />
      </div>
      <Bottom />
    </div>
  );
};

export default Resources4;
